import React, { useState } from "react";
import {
  Button,
  Alert,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
} from "reactstrap";
import { useAuth0, withAuthenticationRequired } from "@auth0/auth0-react";
import { getConfig } from "../config";
import Loading from "../components/Loading";

const MainPage = () => {
  const { apiOrigin = "http://localhost:3001", audience } = getConfig();

  const [state, setState] = useState({
    showModal: false,
    reportName: "",
    reportDescription: "",
    reportDate: "",
    reportImage: null,
  });

  const {
    getAccessTokenSilently,
    loginWithPopup,
    getAccessTokenWithPopup,
  } = useAuth0();

  const toggleModal = () => {
    setState((prevState) => ({
      ...prevState,
      showModal: !prevState.showModal,
    }));
  };

  const handleLoginAgain = async () => {
    try {
      await loginWithPopup();
      setState({
        ...state,
        error: null,
      });
    } catch (error) {
      setState({
        ...state,
        error: error.error,
      });
    }

    // You can call the API or perform other actions here if needed
  };

  const handleCreateReport = async () => {
    // Handle report creation here, you can use the state properties:
    // state.reportName, state.reportDescription, state.reportDate, state.reportImage

    // After handling report creation, you can close the modal
    toggleModal();
  };

  return (
      <div className="text-center d-flex justify-content-center align-items-center h-100">
        <div>
          <h1>Main Page</h1>
          <div className="mb-5">
            {state.error === "login_required" && (
                <Alert color="warning">
                  You need to{" "}
                  <a
                      href="#/"
                      className="alert-link"
                      onClick={handleLoginAgain}
                  >
                    log in again
                  </a>
                </Alert>
            )}
            <Button color="primary" className="mt-3 mr-2" onClick={toggleModal}>
              Report
            </Button>
            <Button color="primary" className="mt-3" onClick={handleDonate}>
              Donate Carbon Credit
            </Button>
          </div>
        </div>
        <Modal isOpen={state.showModal} toggle={toggleModal}>
          <ModalHeader toggle={toggleModal}>Create Report</ModalHeader>
          <ModalBody>
            <form>
              <div className="form-group">
                <label>Report Name:</label>
                <input
                    type="text"
                    className="form-control"
                    value={state.reportName}
                    onChange={(e) => setState({ ...state, reportName: e.target.value })}
                />
              </div>
              <div className="form-group">
                <label>Report Description:</label>
                <textarea
                    className="form-control"
                    rows="3"
                    value={state.reportDescription}
                    onChange={(e) => setState({ ...state, reportDescription: e.target.value })}
                />
              </div>
              <div className="form-group">
                <label>Date:</label>
                <input
                    type="date"
                    className="form-control"
                    value={state.reportDate}
                    onChange={(e) => setState({ ...state, reportDate: e.target.value })}
                />
              </div>
              <div className="form-group">
                <label>Image:</label>
                <div className="custom-file">
                  <input
                      type="file"
                      className="custom-file-input"
                      onChange={handleImageChange}
                  />
                  <label className="custom-file-label">
                    {state.reportImage ? state.reportImage.name : "Choose file"}
                  </label>
                </div>
              </div>
            </form>
          </ModalBody>
          <ModalFooter>
            <Button color="primary" onClick={handleCreateReport}>
              Submit
            </Button>{" "}
            <Button color="secondary" onClick={toggleModal}>
              Cancel
            </Button>
          </ModalFooter>
        </Modal>
      </div>
  );
};

export default withAuthenticationRequired(MainPage, {
  onRedirecting: () => <Loading />,
});
